INSERT INTO `berita` (`id_berita`, `id_user`, `id_kategori`, `updater`, `slug_berita`, `judul_berita`, `isi`, `status_berita`, `jenis_berita`, `keywords`, `gambar`, `icon`, `hits`, `urutan`, `tanggal_mulai`, `tanggal_selesai`, `tanggal_post`, `tanggal_publish`, `tanggal`) VALUES
(6, 3, 4, '', 'wijaya-karya-kasih-pinjaman-untuk-winner-senilai-rp36-miliar', 'Wijaya Karya Kasih Pinjaman untuk WINNER Senilai Rp36 Miliar', '<p style=\"text-align: justify;\">PT Wijaya Karya (Persero) Tbk atau WIKA melalui anak usahanya, PT Wijaya Karya Rekayasa Konstruksi atau WKR memberikan fasilitas pinjaman&nbsp;<em>non cash loan</em>&nbsp;kepada PT Wijaya Karya Industri Energi atau WINNER senilai Rp36 miliar.</p>\r\n<p style=\"text-align: justify;\">Mengutip keterbukaan informasi di&nbsp;<em>Bursa Efek Indonesia (BEI)</em>, untuk menunjang kegiatan operasionalnya, WINNER membutuhkan plafon pinjaman berupa pemanfaatan fasilitas&nbsp;<em>non cash loan</em>&nbsp;yang diperoleh dari pemegang saham perseroan yang dalam hal ini adalah WRK.</p>\r\n<p style=\"text-align: justify;\">Fasilitas pinjaman tersebut telah disetujui dalam Rencana Kerja dan Anggaran Perusahaan (RKAP) WRK Tahun 2022 dan RKAP WINNER Tahun 2022. Keduanya menandatangani perjanjian fasilitas pinjaman tersebut pada 11 Juli 2022 lalu. Transaksi pemberian fasilitas pinjaman ini merupakan transaksi berkelanjutan atau berulang yang nilainya telah dianggarkan dan disetujui setiap tahunnya di dalam RKAP.</p>\r\n<p style=\"text-align: justify;\">Sementara itu, realisasi pemberian fasilitas pinjaman dilakukan secara berkelanjutan atau berulang, yang mana nilai transaksi yang diberikan tidak secara sekaligus, namun pelaksanaannya dilakukan berdasarkan kebutuhan dari WINNER.</p>\r\n<p style=\"text-align: justify;\">Sekretaris Perusahaan WIKA Mahendra Vijaya mengatakan, transaksi ini dilakukan sebagai upaya perseroan dalam mendukung operasional WINNER dengan cara memperoleh pendanaan, dengan tujuan agar WRK memperoleh imbal hasil berupa kompensasi penggunaan fasilitas pinjaman.</p>\r\n<p style=\"text-align: justify;\">&ldquo;Hal itu akan menambah pendapatan dan memberikan kontribusi positif terhadap keuangan konsolidasi perseroan,&rdquo; kata Mahendra dalam keterbukaan informasi, Kamis (14/72022).</p>\r\n<p style=\"text-align: justify;\">Untuk informasi, WIKA saat ini merupakan pemegang saham WRK dengan kepemilikan saham sebesar 97,99% dan WINNER dengan kepemilikan saham sebesar 40,00%. Selain itu, WRK juga merupakan pemegang saham WINNER dengan kepemilikan saham sebesar 60%.</p>', 'Publish', 'Berita', '', 'pexels-sora-shimazaki-5673488.jpg', NULL, 2, 0, NULL, NULL, '2022-09-17 12:42:31', '2022-09-17 12:38:14', '2022-10-17 00:18:44'),
(7, 3, 5, '', 'hadjar-seti-adji-jadi-direktur-wika-berikut-susunan-direksi-dan-komisaris', 'Hadjar Seti Adji Jadi Direktur WIKA, Berikut Susunan Direksi dan Komisaris', '<p>Kementerian Badan Usaha Milik Negara (BUMN) menunjuk Hadjar Seti Adji sebagai Direktur Human Capital dan Pengembangan melalui Rapat Umum Pemegang Saham Luar Biasa (RUPSLB) PT Wijaya Karya (Persero) Tbk. (WIKA).</p>\r\n<p>Sekretaris Perusahaan Wijaya Karya Mahendra Vijaya mengatakan, Hadjar Seti Adji menggantikan direktur sebelumnya, yaitu Mursyid dalam RUSPLB.</p>\r\n<p>&ldquo;RUPSLB menyetujui pengangkatan Hadjar Seti Adji sebagai Direktur Human Capital dan Pengembangan Usaha Perseroan menggantikan Direktur sebelumnya yang mendapatkan penugasan di BUMN yang lain,&rdquo; tulis Mahendra melalui keterangan pers, Jumat (5/8/2022).</p>\r\n<p>Menurut laman resmi PT Waskita Toll Road, Hadjar sebelumnya pernah menjabat sebagai Direktur SDM dan Pengembangan Sistem PT Waskita Karya (Persero) Tbk (WSKT) mulai tahun 2020. Pada rentang 2014 &ndash; 2018 menjabat sebagai Kepala Divisi Riset dan Teknologi PT PP (Persero), kemudian pada 2016 menjabat sebagai Kepala Divisi Penegembangan Bisnis PT PP (Persero).</p>\r\n<p>Hadjar Seti Adji merupakan lulusan S1 Teknik Sipil Universitas Diponegoro, Semarang pada tahun 1991. Kemudian mengambil gelar master di University of New South Wales, Sydney, Australia sebagai Master in Construction Management pada 2002.</p>\r\n<p><strong>Susunan Direksi</strong></p>\r\n<p><strong>Direktur Utama :</strong>&nbsp;Agung Budi Waskito<br /><strong>Direktur Operasi I :</strong>&nbsp;Hananto Aji<br /><strong>Direktur Operasi II :</strong>&nbsp;Harum Akhmad Zuhdi<br /><strong>Direktur Operasi III :</strong>&nbsp;Rudy Hartono<br /><strong>Direktur Human Capital dan Pengembangan :</strong>&nbsp;Hadjar Seti Adji<br /><strong>Direktur QHSE :</strong>&nbsp;Ayu Widya Kiswari<br /><strong>Direktur Keuangan :</strong>&nbsp;Adityo Kusumo</p>\r\n<p><strong>Susunan Komisaris</strong></p>\r\n<p><strong>Komisaris Komisaris Utama :</strong>&nbsp;Jarot Widyoko<br /><strong>Komisaris :</strong>&nbsp;Rusmanto<br /><strong>Komisaris :</strong>&nbsp;Firdaus Ali<br /><strong>Komisaris :</strong>&nbsp;Satya Bhakti Parikesit<br /><strong>Komisaris :</strong>&nbsp;Adityawarman<br /><strong>Komisaris :&nbsp;</strong>Harris Arthur Hedar<br /><strong>Komisaris :</strong>&nbsp;Suryo Hapsoro Tri Utomo</p>', 'Publish', 'Berita', '', 'hadjar_seti_adji.jpg', '', 3, 0, NULL, NULL, '2022-09-17 12:51:58', '2022-09-17 12:43:35', '2022-09-29 09:11:28'),
(8, 3, 4, '', 'setangga-coal-terminal-120-tpy', 'Setangga Coal Terminal 120 TPY', '<p><strong>SETANGGA</strong>- PT.Wijaya Karya Rekayasa Konstruksi (WIKA REKON) sedang menggarap proyek terminal batubara yang berlokasi di Setangga, Tanah Bumbu, Kalimantan Selatan. Proyek ini merupakan tender dari PT Jhonlin Baratama yang bergerak dibidang tambang batu bara. PT Jhonlin Baratama sendiri merupakan salah satu perusahaan pertambangan yang cukup bonafit. Perusahaan tersebut merupakan milik orang terkaya di Kalimantan Selatan yaitu Andi Syamsuddin Arsyad atau lebih dikenal sebagai Haji Isam, yang sudah terdengar sepak terjangnya dalam dunia bisnis terutama pada sektor Kelapa Sawit dan Batubara.</p>\r\n<p>Progres pengerjaan proyek ini sudah mencapai 25%, untuk pengerjaannya sudah pada tahap Radial Ship Loader.&nbsp;Proyek ini diharapkan akan selesai pada akhir tahun 2022. Hal yang cukup menjadi kendala dalam pengerjaan proyek ini adalah hujan yang tidak menentu, yang seringkali menghambat para pekerja dalam mengerjakan proyek ini.</p>\r\n<p>Mengingat waktu estimasi proyek yang terbilang cukup singkat, bapak gunar hendarko dan tim selalu berupaya maksimal dalam mengerjakan setiap detail kegiatan, hal tersebut dilakukan untuk mengurangi kesalahan yang dapat berakibat molornya estimasi pengerjaan proyek.</p>', 'Publish', 'Berita', 'Proyek pembangunan setangga coal terminal', '16647785939401.jpg', '', 9, 0, NULL, NULL, '2022-09-28 07:26:51', '2022-09-28 07:13:01', '2022-10-05 08:12:20'),
(10, 3, 7, '', 'sejarah-perusahaan', 'Sejarah Perusahaan', '<p><strong>1984</strong><br />Empat orang pegawai dari Wasamitra mendirikan perusahaan jasa instalasi mekanikal dan elektrikal, yakni PT Catur Insan Pertiwi.</p>\r\n<p><strong>2008</strong><br />18 November 2008 PT Wijaya Karya (Persero) Tbk, WIKA, mengakuisisi PT Catur Insan Pertiwi untuk mengembangkan bisnis EPC WIKA, dengan menguasai 70% saham dan mengganti nama perusahaan menjadi PT WIKA Insan Pertiwi.</p>\r\n<p><strong>2013</strong><br />Perubahan bisnis perusahaan menjadi perusahaan yang bergerak dibidang EPC dan O&amp;M, sehingga perusahaan mengganti nama menjadi PT Wijaya Karya Rekayasa Konstruksi.</p>\r\n<p>PT Wijaya Karya Rekayasa Konstruksi (WIKA REKON) merupakan salah satu anak perusahaan dari PT Wijaya Karya (Persero) Tbk. yang bergerak dibidang Jasa Konstruksi , Jasa Engineering Procurement dan Construction, Jasa Fabrikasi, Jasa Pengorperasian dan Pemeliharaan serta Investasi.</p>\r\n<p>WIKA REKON yang utama melakukan pekerjaan-pekerjaan di bidang MEP (Mechanical, Electrical, Piping), EPCC (Engineering, Procurement, Construction, Commissioning), O&amp;M (Operation &amp; Maintenance) serta Investasi.</p>\r\n<p>Sebagai perusahaan yang sudah mempunyai banyak pengalaman, WIKA REKON menyajikan pelayanan serta pekerjaan yang terbaik bagi setiap pemangku kepentingan, sehingga apa yang dihasilkan dari setiap pekerjaan dapat bermanfaat bagi semua pihak.</p>', 'Publish', 'Profil', '', 'pexels-sevenstorm-juhaszimrus-439416.jpg', NULL, 4, 1, NULL, NULL, '2022-09-30 10:24:07', '2022-09-30 10:22:08', '2022-10-17 00:22:36'),
(11, 3, 7, '', 'visi-misi', 'VISI & MISI', '<div class=\"elementor-column elementor-col-50 elementor-top-column elementor-element elementor-element-c8ab521\" data-id=\"c8ab521\" data-element_type=\"column\">\r\n<div class=\"elementor-widget-wrap elementor-element-populated\">\r\n<div class=\"elementor-element elementor-element-9fd406c elementor-widget elementor-widget-heading\" data-id=\"9fd406c\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">Visi</h2>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-column elementor-col-50 elementor-top-column elementor-element elementor-element-3338636\" data-id=\"3338636\" data-element_type=\"column\">\r\n<div class=\"elementor-widget-wrap elementor-element-populated\">\r\n<div class=\"elementor-element elementor-element-0c0ccea elementor-widget elementor-widget-text-editor\" data-id=\"0c0ccea\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p>Menjadi Perusahaan Total Solution Bidang Energi yang Terintegrasi dan Terkemuka di Asia Tenggara.</p>\r\n<p><strong>Total Solution</strong><br />Merupakan strategi bisnis WRK yang meliputi MEP, EPCC mengarah pada Renewable Energy dan Operation &amp; Maintenance serta Investasi</p>\r\n<p><strong>Terintegrasi</strong><br />Adalah bentuk sinergi dengan Holding dan Anak Perusahaan.</p>\r\n<p>&nbsp;</p>\r\n<div class=\"elementor-column elementor-col-50 elementor-top-column elementor-element elementor-element-6a71cc8\" data-id=\"6a71cc8\" data-element_type=\"column\">\r\n<div class=\"elementor-widget-wrap elementor-element-populated\">\r\n<div class=\"elementor-element elementor-element-48fe89b elementor-widget elementor-widget-heading\" data-id=\"48fe89b\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">Misi</h2>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-column elementor-col-50 elementor-top-column elementor-element elementor-element-0a3ea65\" data-id=\"0a3ea65\" data-element_type=\"column\">\r\n<div class=\"elementor-widget-wrap elementor-element-populated\">\r\n<div class=\"elementor-element elementor-element-ed09ed5 elementor-widget elementor-widget-text-editor\" data-id=\"ed09ed5\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p>Menerapkan Sistem Manajemen WRK dan GCG dalam semua kegiatan bisnis.</p>\r\n<p>Menyediakan jasa MEP, EPCC Renewable Energy dan Operation &amp; Maintenance serta melakukan Investasi dalam bidang energi dengan mengoptimalkan sinergi BUMN dan WIKA Group untuk menciptakan keuntungan dan bisnis yang berkelanjutan.</p>\r\n<p>Meningkatkan kompetensi dan kinerja serta mengembangkan kapabilitas Human Capital.</p>\r\n<p>Membangun kerjasama bisnis dengan partner strategis untuk menciptakan peluang yang berkelanjutan baik di Indonesia.</p>\r\n<p>Mengimplementasikan integrasi sistem menejemen berbasis digital dalam pengelolaan bisnis.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'Publish', 'Profil', '', 'PT_WIKA_Rekayasa_Konstruksi1.png', NULL, 1, 2, NULL, NULL, '2022-09-30 10:25:35', '2022-09-30 10:24:38', '2022-10-17 00:22:11'),
(12, 3, 7, '', 'nilai-nilai-perusahaan', 'Nilai-Nilai Perusahaan', '<div class=\"elementor-column elementor-col-16 elementor-top-column elementor-element elementor-element-581efb1\" data-id=\"581efb1\" data-element_type=\"column\">\r\n<div class=\"elementor-widget-wrap elementor-element-populated\">\r\n<div class=\"elementor-element elementor-element-04b24e8 elementor-widget elementor-widget-heading\" data-id=\"04b24e8\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h3 class=\"elementor-heading-title elementor-size-default\">AMANAH</h3>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-40dedcb elementor-widget elementor-widget-text-editor\" data-id=\"40dedcb\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p>Memegang teguh kepercayaan yang diberikan</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-column elementor-col-16 elementor-top-column elementor-element elementor-element-a30c48c\" data-id=\"a30c48c\" data-element_type=\"column\">\r\n<div class=\"elementor-widget-wrap elementor-element-populated\">\r\n<div class=\"elementor-element elementor-element-c6f31bc elementor-widget elementor-widget-heading\" data-id=\"c6f31bc\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h3 class=\"elementor-heading-title elementor-size-default\">KOMPETEN</h3>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-3fc944b elementor-widget elementor-widget-text-editor\" data-id=\"3fc944b\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p>Terus belajar dan mengembangkan kapabilitas</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-column elementor-col-16 elementor-top-column elementor-element elementor-element-5ef3ff4\" da