elementor-widget elementor-widget-heading\" data-id=\"f70801f\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h3 class=\"elementor-heading-title elementor-size-default\">ADAPTIF</h3>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-572bab1 elementor-widget elementor-widget-text-editor\" data-id=\"572bab1\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p>Terus berinovasi dan antusias dalam menggerakan ataupun menghadapi perubahan</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-column elementor-col-16 elementor-top-column elementor-element elementor-element-e447a21\" data-id=\"e447a21\" data-element_type=\"column\">\r\n<div class=\"elementor-widget-wrap elementor-element-populated\">\r\n<div class=\"elementor-element elementor-element-67c8167 elementor-widget elementor-widget-heading\" data-id=\"67c8167\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h3 class=\"elementor-heading-title elementor-size-default\">KOLABORATIF</h3>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-a308fc4 elementor-widget elementor-widget-text-editor\" data-id=\"a308fc4\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p>Membangun kerja sama yang sinergis</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'Publish', 'Profil', '', 'akhlak-bumn.png', NULL, 0, 3, NULL, NULL, '2022-09-30 10:27:42', '2022-09-30 10:26:17', '2022-10-17 00:21:49'),
(13, 3, 7, '', 'budaya-perusahaan', 'Budaya Perusahaan', '<div class=\"elementor-element elementor-element-9013a4f elementor-widget elementor-widget-heading\" data-id=\"9013a4f\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">\"Customer First\"</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-19a708a elementor-widget elementor-widget-text-editor\" data-id=\"19a708a\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p>Pelanggan adalah prioritas utama kami<br />Kami berusaha memberikan layanan yang superior yang tepat waktu dan aman bagi pelanggan kami.</p>\r\n<p>Setiap karyawan WIKA REKON bekerja berdasarkan paradigma :</p>\r\n<ul>\r\n<li>Mendorong kepemimpinan yang patut dicontoh dan keunggulan kinerja</li>\r\n<li>Kecepatan, akurasi, dan efisiensi adalah faktor penting</li>\r\n<li>Pengetahuan dan kompetensi adalah aset andalan</li>\r\n<li>Setiap perubahan harus memberikan nilai tambah</li>\r\n<li>Inovasi dan kepuasan pelanggan adalah komitmen setiap karyawan</li>\r\n</ul>\r\n</div>\r\n</div>', 'Publish', 'Profil', '', 'pexels-pixabay-416405.jpg', NULL, 5, 4, NULL, NULL, '2022-09-30 10:28:35', '2022-09-30 10:27:51', '2022-10-17 00:21:26'),
(14, 3, 6, '', 'first-pilling-bangkirai-intermediate-stockpile-onground-conveyor', 'First Pilling Bangkirai Intermediate Stockpile & Onground Conveyor', '<p>WIKA REKON bersama PT Dua Samudera Perkasa melakukan First Piling Proyek Bangkirai Intermediate Stockpile &amp; Onground Conveyor Systems.<br /><br />Tanah Bumbu - PT Wijaya Karya Rekayasa Konstruksi (WIKA REKON) dan PT Dua Samudera Perkasa (DSP) telah menggelar acara First Piling Proyek Bangkirai Intermediate Stockpile &amp; Onground Conveyor Systems yang terletak di Sungai Dua, Kab. Tanah Bumbu, Kalimantan Selatan, pada hari Sabtu 1 Oktober 2022.<br /><br />Acara tersebut dihadiri oleh CEO PT Jhonlin Group Ghimoyo, Manajer Strategic Management Office Jhonlin Group Falah, Direktur Utama DSP Hartantono, Port Manager DSP Gendhis dan Manajer Proyek Bangkirai Intermediate Stockpile &amp; Onground Conveyor Systems WIKA REKON Gunar Hendarko.<br /><br />Rangkaian acara First Piling tersebut diawali dengan pembukaan yang dilanjutkan dengan sambutan dari perwakilan Jhonlin Group oleh Bapak Ghimoyo, disambung sambutan dari DSP oleh Bapak Hartantono dan dari Manajer Proyek Bangkirai WIKA REKON Gunar Hendarko. Kemudian acara dilanjutkan ke acara utama yaitu rangkaian first piling yang diawali dengan pembacaan doa, setelah itu acara ditutup dengan potong tumpeng dan makan siang bersama.<br /><br />Sebagai perwakilan dari DSP, dalam sambutannya Hartantono menuturkan bahwa proyek yang akan dilaksanakan ini diharapkan bisa memberikan kontribusi yang baik dan sesuai target serta dapat diselesaikan dengan tepat waktu.<br /><br />Dengan diadakannya acara First Piling tersebut maka pengerjaan Proyek Bangkirai Intermediate Stockpile &amp; Onground Conveyor Systems yang terletak di Sungai Dua, Kab. Tanah Bumbu, Kalimantan Selatan ini secara resmi sudah dapat dimulai.</p>', 'Publish', 'Berita', 'First Pilling', 'WhatsApp_Image_2022-10-03_at_10_00_54.jpeg', '', 5, 0, NULL, NULL, '2022-10-03 09:00:08', '2022-10-03 08:48:45', '2022-10-05 08:51:49'),
(15, 3, 4, '', 'first-pilling-serongga', 'First Pilling Serongga', '<p>Kotabaru - Acara first pilling proyek Serongga Coal Terminal yang diadakan oleh PT Wika Rekayasa Konstruksi (WIKA REKON) bersama dengan PT Dua Samudra Perkasa (DSP) pada hari Senin, 10 Oktober 2022 telah berjalan dengan lancar. Acara tersebut berlokasi di Kelumpang Hilir, Kab. Kotabaru, Kalimantan Selatan.</p>\r\n<p>Dalam acara tersebut dihadiri oleh pimpinan beserta staf dari kedua perusahaan, diantaranya Manajer Strategic Management Office Jhonlin Group Falah, Perwakilan DSP Frans, Manajer Proyek Serongga Coal Terminal WIKA REKON Gunar Hendarko dan undangan lainnya.</p>\r\n<p>Acara First Pilling tersebut diawali dengan pembukaan kemudian dilanjutkan dengan sambutan dari perwakilan Jhonlin Group Bapak Falah, sambutan kedua disampaikan perwakilan dari DSP Bapak Frans, dan disambung sambutan dari Manajer Proyek Serongga Coal Terminal Bapak Gunar Hendarko. Memasuki acara inti yaitu rangkaian first pilling, yang diawali dengan doa bersama, kemudain acara ditutup dengan pemotongan tumpeng dan makan siang bersama.</p>\r\n<p>Dengan diadakannya acara First Pilling ini maka pengerjaan proyek Serongga Coal Terminal secara resmi siap dimulai.</p>', 'Publish', 'Berita', '', '16648520981232.jpg', NULL, 2, 0, NULL, NULL, '2022-10-15 09:31:32', '2022-10-15 09:26:14', '2022-10-15 05:21:37');
