INSERT INTO `video` (`id_video`, `judul`, `posisi`, `keterangan`, `video`, `urutan`, `bahasa`, `id_user`, `tanggal`) VALUES
(4, 'Profil Wika Rekayasa Konstruksi', 'Homepage', '12 TH WIKA REKAYASA KONSTRUKSI', '2YDJdMGxIMg', 1, 'Indonesia', 3, '2022-09-15 00:15:45'),
(5, 'Video Profile PT. Wijaya Karya (Persero) Tbk', 'Homepage', 'Company Profil PT. WIKA (Persero) Tbk - Indonesian Version', 'ti6Z_O2muHs', 2, 'Indonesia', 3, '2022-09-15 00:21:34'),
(0, 'Rekrutmen PT. WIKA', 'Homepage', 'Rekrutmen PT. Wijaya Karya (Persero) Tbk', 'C-7pcRu2hzE', 3, 'Indonesia', 3, '2022-09-15 01:24:23'),
(0, 'Kemudi WIKA Rekayasa Konstruksi di Masa Depan', 'Homepage', 'PT Wijaya Karya Rekayasa Konstruksi (WRK), salah satu entitas anak PT Wijaya Karya (Persero) Tbk. (WIKA) yang berfokus pada bisnis Engineering Procurement & Construction (EPC), Operating & Maintenance (OM), serta Investasi yang hadir untuk mendukung dan memperkuat pilar bisnis WIKA.\r\n\r\nMenyongsong masa depan yang makin gemilang, WRK kini telah memantapkan langkahnya dengan strategi-strategi unggulan untuk menjawab peluang dan tantangan yang telah ditargetkan di tahun 2019 dan mendatang. \r\n\r\nBersama nahkoda WRK yaitu Bapak Hendra Jayusman selaku Direktur Utama, Bapak Anung Caksono Adi selaku Direktur Bisnis Strategis & Investasi, Bapak Eko Susilo Prayitno selaku Direktur Operasi  serta Bapak Zakaria selaku Direktur Keuangan dan Human Capital , kami dicerahkan mengenai bagaimana prospek bisnis WRK dan potensi pengembangannya di masa mendatang. \r\n\r\nSeperti apa hasil perbincangan kami dengan para punggawa WRK tersebut?\r\n\r\nMari kita simak videonya!', 'JPft0PRmsdY', 1, 'Indonesia', 3, '2022-09-15 01:27:12');
